import React from 'react';
import { Card, Avatar } from 'antd';

const UserProfile = () => {
  return (
    <Card>
      <Card.Meta avatar={<Avatar>KHJ</Avatar>} title="KHJcode" />
    </Card>
  );
};

export default UserProfile;
